function ShowtimeFilmRightDetail(props) {
  return (
    <div className="wp__tabRightDetailMovie">
      <ShowtimeFilmRightTopDetail />
      <ShowtimeFilmRightBottomDetail />
    </div>
  );
}

export default ShowtimeFilmRightDetail;
